<?phpfunction getTravelTime($origin,$listings,$transit){	$url="https://maps.googleapis.com/maps/api/distancematrix/json?origins=Vancouver+BC|Seattle&destinations=San+Francisco|Victoria+BC&key=AIzaSyAA99PM_Xfqfhc8KTHSF3LwO6iXMGx0TrM";$curl = curl_init($url);	  curl_setopt_array($curl, array(	CURLOPT_RETURNTRANSFER => true));	 	  // $response is a JSON string$response = curl_exec($curl); 	  $httpCode = curl_getinfo($curl, CURLINFO_HTTP_CODE);	  curl_close($curl);if ($httpCode != 200) {	echo "<script type='text/javascript'>alert('fail');</script>";}else{	echo "<script type='text/javascript'>alert('succses');</script>";}// $result is a JSON object  $result = json_decode($response);$stat = $result->status;echo "<script type='text/javascript'>alert('$stat');</script>";return $listings;}?>